import t1 from "../components/assets/t1.png";
import t2 from "../components/assets/t2.png";
import t3 from "../components/assets/t3.png";

const Mrq1 = () => {
  return (
    <div style={{ paddingTop: "15px" }}>
      <div>
        <section id="hire">
          <div className="container-fluid">
            <div className="jumbotron jumbotron-fluid">
              <div className="container hir">
                <marquee direction="left" style={{width: '80%'}}>
                  <div>
                    <img
                      src={t1}
                      alt="doni"
                      style={{ width: "250px", height: "250px", marginRight: '185px'}}
                    />
                    <img
                      src={t3}
                      alt="doni"
                      style={{ width: "250px", height: "250px", marginRight: '185px' }}
                    />
                    <img
                      src={t2}
                      alt="doni"
                      style={{ width: "250px", height: "250px" }}
                    />
                  </div>
                </marquee>
              </div>
            </div>
          </div>
        </section>
      </div>
    </div>
  );
};

export default Mrq1;
